(function() {
    'use strict';
const mascotswap = document.getElementById("mascot-swap");
if (mascotswap) {
    mascotswap.insertAdjacentHTML("beforebegin", '<a href="#" id="mascot-customizer">Select mascot</a>');
    const mascotCustomizerbtn = document.getElementById("mascot-customizer");
    mascotCustomizerbtn.addEventListener("click", customize);
}

const mascUrl = localStorage.getItem("mascUrl");
const mascAuthor = localStorage.getItem("mascAuthor");
const mascAuthorLink = localStorage.getItem("mascAuthorLink");
const mascColor = localStorage.getItem("mascColor");

if (mascUrl == null || mascAuthor == null || mascAuthorLink == null || mascColor == null) {
localStorage.setItem("mascUrl", 'data:image/jpeg;base64,');
localStorage.setItem("mascAuthor", 'koke228');
localStorage.setItem("mascAuthorLink", 'https://ovk.to/koke228');
localStorage.setItem("mascColor", '#012e56');
}

function customize(event) {
    event.preventDefault();
    const mascUrlc = prompt("Enter mascot url:");
    const mascAuthorc = prompt("Enter mascot author:");
    const mascAuthorLinkc = prompt("Enter mascot author link:");
    const mascColorc = prompt("Enter mascot background color:");
    if (mascUrlc !== null && mascAuthorc !== null && mascAuthorLinkc !== null && mascColorc !== null) {
        localStorage.setItem("mascUrl", mascUrlc);
        localStorage.setItem("mascAuthor", mascAuthorc);
        localStorage.setItem("mascAuthorLink", mascAuthorLinkc);
        localStorage.setItem("mascColor", mascColorc);
    }
    localStorage.setItem("mascot", Math.max(...Object.keys(mascots).map(Number)));
    location.reload();
}

var mascots = window.mascots;
var maskCustId = Math.max(...Object.keys(mascots).map(Number)) + 1;
mascots[maskCustId] = {
    id: maskCustId,
    background_color: localStorage.getItem("mascColor"),
    artist_url: localStorage.getItem("mascAuthorLink"),
    artist_name: localStorage.getItem("mascAuthor"),
    background_url: localStorage.getItem("mascUrl")
};

})();
